import React , {useEffect , useState} from 'react'
import axios from 'axios'

function SearchDishes() {

  const [dishName , setDishName] = useState("")

  return (
    <div>
      <div style={{textAlign : "center"}}>
        <h2>SearchDishes</h2>
        <input 
        value = {dishName}
        onChange={()=>{}}
        placeholder='Search Dishes'/>
      </div>
    </div>
  )
}

export default SearchDishes
